import React from 'react'
import { 
  BrowserRouter as Router,
  Switch,
  Route,
  Link          
} from 'react-router-dom'
import {AppBar, Toolbar, Button} from '@material-ui/core'

function App() {
  return (
    <AppBar>
      <Toolbar>
        <Button color="inherit">Login</Button>
      </Toolbar>
    </AppBar>
  );
}

function Home() {
  return <h2>Home</h2>;
}

function About() {
  return <h2>About</h2>;
}

function Users() {
  return <h2>Users</h2>;
}

export default App;
